window.bookSummaryJSON = "<p><b>The thrilling, 20-years-in-the-making conclusion to the </b><b><i>New York Times </i></b><b>best-selling Queen’s Thief series by Megan Whalen Turner.</b></p> <p>This beloved and award-winning series began with the acclaimed novel <i>The Thief</i>. It and four more standalone volumes bring to life a world of epics, myths, and legends, and feature one of the most charismatic and incorrigible characters of fiction, Eugenides the thief. Now more powerful and cunning than ever before, Eugenides must navigate a perilous future in this sweeping conclusion. Perfect for fans of Leigh Bardugo, Marie Lu, Patrick Rothfuss, and Sarah J. Maas.</p> <p>Neither accepted nor beloved, Eugenides is the uneasy linchpin of a truce on the Lesser Peninsula, where he has risen to be high king of Attolia, Eddis, and Sounis. As the treacherous Baron Erondites schemes anew and a prophecy appears to foretell the death of the king, the ruthless Mede empire prepares to strike.</p> <p>The <i>New York Times </i>best-selling Queen’s Thief novels are rich with political machinations, divine intervention, dangerous journeys, battles lost and won, power, passion, and deception.</p>"; 
